pragma solidity ^0.8.3;

contract EntityTransferPrimitive {
    address worldAddress; 

    constructor(address _worldAddress) {
        worldAddress = _worldAddress; 
    }
    function invoke(uint32 _id, address _newOwner) public {
        bool error; 
        bytes memory returnval; 
        (error, returnval) = msg.sender.delegatecall(abi.encodeWithSignature("changeEntityOwner(uint32, address)", _id, _newOwner));
        // if (error) revert(); 
    }
}
